import React from "react"
import ReactDOM from "react-dom"

const color = ["Green","Blue","Black"]
const colors = color.map((clr)=>{
    return `<h1>${clr}</h1>`
})


function App(){
    return(
        <div>
            <h1>{colors}</h1>
        </div>
    )
}

ReactDOM.render(<App/>,document.getElementById("root"))
